import React from "react";
import "./Toolbar.css";
import logo from "../res/logo.png"

function Toolbar() {
    return (
        <div className="Toolbar">
            <img src={ logo } />
            <a href="/">Home</a>
            <a href="/about">About</a>
            <a href="/projects">Projects</a>
            {(localStorage.getItem('username') === "") ? <a href="/login">Login</a> : <a href="/login">{localStorage.getItem('username')}</a>}
        </div>
    );
}

export default Toolbar;
